"use strict";

// Hide Header on on scroll down
var didScroll;
var lastScrollTop = 0;
var delta = 20;

document.addEventListener("scroll", function (event) {
    didScroll = true;
});

setInterval(function () {
    if (didScroll) {
        hasScrolled();
        didScroll = false;
    }
}, 250);

function hasScrolled() {
    var st = window.scrollY;

    // Make sure they scroll more than delta
    if (Math.abs(lastScrollTop - st) <= delta) return;

    // If they scrolled down and are past the navbar, add class .nav-up.
    // This is necessary so you never see what is "behind" the navbar.
    if (st < lastScrollTop) {
        // Scroll Down
        tal.showSecondaryHeader = false;
    } else {
        // Scroll Up
        //if(st + window.innerHeight < document.innerHeight) {
        tal.showSecondaryHeader = true;
        //}
    }

    lastScrollTop = st;
}
"use strict";

var tal = {
  sale: {
    name: "Orlando, FL, USA",
    location: "Orlando, FL, USA",
    lotRange: {
      start: 5001,
      end: 5495
    },
    paused: false
  },
  preSoldOffset: 20,
  closeInterval: 30,
  currentTime: moment(),
  bidder: {
    number: "12345"
  },
  categories: categories,
  lots: lotlist,
  watchedLots: ["5001", "5022", "5028", "5031", "5042", "5045"],
  mobileMoreMenuVisible: false,

  selectedLot: 0,
  confirmPlaceBidVisible: false,
  confirmPlaceMaxBidVisible: false,
  invalidMaxBidVisible: false,
  offIncrementMaxBidVisible: false,

  groupMaximumLots: 20,
  creatingChoiceGroup: false,
  tempChoiceGroupArray: [],
  tempChoiceGroup: [],
  choiceProgress: 1,
  completeChoiceGroupModalVisible: false,
  choiceGroups: [{
    uid: "123456",
    type: "group",
    lots: ["5099", "5100", "5101", "5102"],
    quantity: 2,
    maxbid: 100
  }],

  purchasedLots: ["5001", "5004"],
  searchResults: ["5045", "5046", "5047", "5048", "5049", "5050"],

  manageAlertsVisible: false,

  increments: incrementTable,

  activeThumbnail: 0,

  pausedMessageVisible: false,

  showSecondaryHeader: true
};

document.addEventListener("DOMContentLoaded", function () {
  for (var i = 0; i < tal.lots.length; i++) {
    tal.lots[i].closes = moment().add((i - tal.preSoldOffset) * tal.closeInterval, "seconds");
  }

  // setInterval(function(){
  //   app.currentTime = moment();
  // },1000);

  var waypoint = new Waypoint({
    element: document.querySelector(".js--nav-pin-waypoint"),
    handler: function handler(direction) {
      var body = document.querySelector("body");
      if (direction === "down") {
        body.classList.add("s-pin-nav");
        var headerheight = document.querySelector(".js--pinned-header").offsetHeight;
        document.querySelector(".js--nav-pin-waypoint").style.height = headerheight + "px";
        //document.querySelector('body').scrollTop -= headerheight;
      } else {
        body.classList.remove("s-pin-nav");
        document.querySelector(".js--nav-pin-waypoint").style.height = "0px";
      }
    }
  });
}, false);

var app = new Vue({
  el: ".js--tal",
  data: tal,
  methods: {
    isSold: function isSold(status) {
      if (status === "sold") return true;
      return false;
    },
    userIsHighBidder: function userIsHighBidder(bids) {
      if (typeof bids[0] != "undefined" && bids[0].bidder === this.bidder.number) return true;
      return false;
    },
    userWasOutbid: function userWasOutbid(bids) {
      if (typeof bids[0] === "undefined") return false;
      if (bids[0].bidder === this.bidder.number) return false;
      for (var i = 1; i < bids.length; i++) {
        if (bids[i].bidder === this.bidder.number) return true;
      }
    },
    userIsMaxBidder: function userIsMaxBidder(lot) {
      if (lot.maxBid.bidder === this.bidder.number) return true;
      return false;
    },
    userHasInGroupBid: function userHasInGroupBid(lotNumber) {
      var grouped = this.choiceGroups.filter(function (group) {
        return group.lots.indexOf(lotNumber) >= 0;
      });
      if (grouped.length > 0) return true;
      return false;
    },
    disableNumberInputScroll: function disableNumberInputScroll(e) {
      e.preventDefault();
    },
    gotoPage: function gotoPage(page) {
      window.location = page + ".html";
    },
    isActivePage: function isActivePage(paths) {
      for (var i = 0; i < paths.length; i++) {
        if (window.location.pathname.split("/").pop() === paths[i]) return {
          "s-active": window.location.pathname.split("/").pop() === paths[i]
        };
      }
    },
    placeBid: function placeBid(lot) {
      this.confirmPlaceBidVisible = true;
      this.selectedLot = lot;
    },
    placeMaxBid: function placeMaxBid(lot) {
      if (lot.tempMaxBid === null) {
        this.toggleInvalidMaxBidVisible();
        lot.tempMaxBid = null;
      } else this.toggleOffIncrementMaxBidVisible();
      //else this.confirmPlaceMaxBidVisible = true;

      this.selectedLot = lot;
    },
    confirmMaxBid: function confirmMaxBid() {
      this.offIncrementMaxBidVisible = false;
      this.confirmPlaceMaxBidVisible = true;
    },
    completeBid: function completeBid() {
      this.confirmPlaceBidVisible = false;
      this.watchLot(this.selectedLot, false);
      this.pricedBid(this.selectedLot, "quick", this.bidder.number, 5);
    },
    watchLot: function watchLot(lot, removeIfExists) {
      if (this.watchedLots.indexOf(lot.lotNumber) < 0) {
        //IF NOT WATCHING YET
        this.watchedLots.push(lot.lotNumber);
      } else {
        if (removeIfExists) this.watchedLots.splice(this.watchedLots.indexOf(lot.lotNumber), 1);
      }
    },
    completeMaxBid: function completeMaxBid() {
      this.confirmPlaceMaxBidVisible = false;
      this.watchLot(this.selectedLot, false);
      this.pricedBid(this.selectedLot, "max", this.bidder.number, 5);
      this.selectedLot.maxBid.bid = this.selectedLot.tempMaxBid;
      this.selectedLot.maxBid.bidder = this.bidder.number;
    },

    pricedBid: function pricedBid(lot, type, bidder, amt) {
      lot.bids.unshift(this.buildBid(bidder, amt, type));
      // if(lot.extended || this.closingSoon(lot)){
      //   lot.closes = moment(lot.closes).add(2,'minutes');
      //   lot.extended = true;
      // } 
    },

    buildBid: function buildBid(bidder, amt, type) {
      var bid = {
        bidder: this.bidder.number,
        bid: amt,
        time: new Date().toJSON(),
        type: type
      };

      return bid;
    },
    toggleInvalidMaxBidVisible: function toggleInvalidMaxBidVisible() {
      this.invalidMaxBidVisible = !this.invalidMaxBidVisible;
    },
    toggleOffIncrementMaxBidVisible: function toggleOffIncrementMaxBidVisible() {
      this.offIncrementMaxBidVisible = !this.offIncrementMaxBidVisible;
    },
    toggleCreateChoiceGroup: function toggleCreateChoiceGroup() {
      this.creatingChoiceGroup = !this.creatingChoiceGroup;
    },
    toggleCompleteChoiceGroupModalVisible: function toggleCompleteChoiceGroupModalVisible() {
      this.completeChoiceGroupModalVisible = !this.completeChoiceGroupModalVisible;
    },
    updateChoiceGroup: function updateChoiceGroup() {
      var _this = this;

      this.tempChoiceGroup = [];
      this.tempChoiceGroupArray.map(function (key) {
        return _this.tempChoiceGroup.push(_this.lots[key]);
      });
    },
    progressClasses: function progressClasses(step) {
      return {
        "s-current": this.choiceProgress === step,
        "s-complete": this.choiceProgress > step
      };
    },
    setChoiceProgress: function setChoiceProgress(step) {
      this.choiceProgress = step;
    },
    finishChoiceGroup: function finishChoiceGroup() {
      for (var i = 0; i < this.tempChoiceGroup.length; i++) {
        console.log(this.tempChoiceGroup[i].status);
        if (this.tempChoiceGroup[i].status === 'notinyard') {
          this.choiceProgress = 5;
          return;
        }
      }

      var newGroup = {
        uid: new Date().toJSON(),
        type: "group",
        lots: this.tempChoiceGroup,
        quantity: this.tempChoiceGroup.length,
        maxbid: 100
      };

      this.choiceGroups.push(newGroup);
      this.toggleCompleteChoiceGroupModalVisible();
    },
    toggleManageAlertsVisible: function toggleManageAlertsVisible() {
      this.manageAlertsVisible = !this.manageAlertsVisible;
    },
    toggleWatchStatus: function toggleWatchStatus(lot) {
      this.watchLot(lot, true);
    },
    lotsInGroup: function lotsInGroup(lots) {
      return this.lots.filter(function (lot) {
        return lots.indexOf(lot.lotNumber) >= 0;
      });
    },
    setActiveThumbnail: function setActiveThumbnail(index) {
      this.activeThumbnail = index;
    },
    nextIncrement: function nextIncrement(lot) {
      return lot.bids.length > 0 ? lot.bids[0].bid + 5 : "5";
    },
    togglePausedMessageVisible: function togglePausedMessageVisible() {
      this.pausedMessageVisible = !this.pausedMessageVisible;
    },
    togglePausedState: function togglePausedState() {
      this.sale.paused = !this.sale.paused;
    },
    toggleMobileMoreMenuVisible: function toggleMobileMoreMenuVisible() {
      this.mobileMoreMenuVisible = !this.mobileMoreMenuVisible;
    },
    createOrAddToChoiceGroup: function createOrAddToChoiceGroup(lot) {
      if (!this.creatingChoiceGroup) this.creatingChoiceGroup = true;
      if (this.tempChoiceGroup.indexOf(lot) < 0) this.tempChoiceGroup.push(lot);
    },

    emptyPurchases: function emptyPurchases() {
      this.purchasedLots = [];
    },
    emptyWatching: function emptyWatching() {
      this.watchedLots = [];
    },
    emptyGroups: function emptyGroups() {
      this.choiceGroups = [];
    },
    emptySearch: function emptySearch() {
      this.searchResults = [];
    },
    toggleViewerMode: function toggleViewerMode() {
      this.bidder.number = this.bidder.number != null ? null : '12345';
    },

    countdown: function countdown(lot) {
      var span = moment.duration(lot.closes - this.currentTime);
      //let extendedSpan = moment.duration(lot.extendedClose - this.currentTime);

      if (span.seconds() < 0) {
        lot.status = 'sold';
      }
      return span.days() + "d " + span.hours() + "h " + span.minutes() + "m " + span.seconds() + "s";
    },

    closingSoon: function closingSoon(lot) {
      if (lot.extended) return true;
      var now = moment();
      var end = moment(lot.closes);
      var span = moment.duration(end - now);
      if (span.days() === 0 && span.hours() === 0 && span.minutes() < 2) return true;
      return false;
    }

  },
  computed: {
    findOneLot: function findOneLot() {
      var context = this;
      return function () {
        var thislot = [];
        var desiredLot = parseInt(window.location.hash.split("#")[1]);
        desiredLot = desiredLot > 0 ? desiredLot : 0;
        thislot.push(context.lots[desiredLot]);
        return thislot;
      };
    },
    lotsImWatching: function lotsImWatching() {
      var _this2 = this;

      return this.lots.filter(function (lot) {
        return _this2.watchedLots.indexOf(lot.lotNumber) >= 0;
      });
    },
    lotsIveWon: function lotsIveWon() {
      var _this3 = this;

      return this.lots.filter(function (lot) {
        return _this3.purchasedLots.indexOf(lot.lotNumber) >= 0;
      });
    },
    searchedLots: function searchedLots() {
      var _this4 = this;

      return this.lots.filter(function (lot) {
        return _this4.searchResults.indexOf(lot.lotNumber) >= 0;
      });
    }
  },
  filters: {
    returnFirstItem: function returnFirstItem(value) {
      if (!value) return "";
      return value[0];
    },
    calendarTime: function calendarTime(time) {
      if (!time) return "";
      return moment(new Date(time)).calendar();
    },
    countdownTime: function countdownTime(closes) {
      if (!closes) return "";
      var now = moment();
      var end = moment(closes);
      var span = moment.duration(end - now);
      return span.days() + "d " + span.hours() + "h " + span.minutes() + "m " + span.seconds() + "s";
    }
  }
});
